pragma solidity 0.6.4;
pragma experimental ABIEncoderV2;

import "../Consortium.sol";
import "../Juice.sol";

contract Publishers {

    // When new publisher was created
    event PublisherCreated(bytes8 indexed id, address indexed owner);

    /*
     *  Publisher Model
     */
    struct Publisher {
        bytes8 id;                  // unique id of publisher
        bool active;                // only active publishers can issue (Owner can modify)
        uint256 created;            // block-time when created
        bytes32[2] checksum;        // hash checksum of identity
        bytes32[2] hosts;           // domain / target entries to off-chain data provider
    }

    // Reference to consortium
    Juice private juice;
    Consortium private consortium;

    bool private locked;            // if true references can't be changed anymore

    // mapping 8bytes key to Publisher
    mapping(bytes8 => address) internal owners;
    mapping(bytes8 => Publisher) internal publishers;

    /**
     *  Requires current consortium address as reference
     */
    constructor(address _consortium, address _juice) public payable {
        juice = Juice(_juice);
        consortium = Consortium(_consortium);
    }

    // ------------------------------------------------------------------------------------------------
    // ------------------------------------------------------------------------------------------------

    /**
      * Create new publisher
      */
    function create(bytes8 id, address owner) public payable {
        require(publishers[id].created == 0, "Publisher already exists");

        Publisher memory b;
        b.id = id;
        b.active = true;
        b.created = block.timestamp;

        publishers[id] = b;
        owners[id] = owner;

        emit PublisherCreated(id, owner);
        juice.charge(msg.sender, consortium.publisherFee());
    }

    modifier _isOwner(bytes8 id, address ownerAddress) {
        require(
            owners[id] == ownerAddress,
            "Only owner is allowed to modify"
        );
        _;
    }

    // ------------------------------------------------------------------------------------------------
    // ------------------------------------------------------------------------------------------------

    /**
     * Set active state
     */
    function setActive(bytes8 id, bool active) public payable _isOwner(id, msg.sender) {
        publishers[id].active = active;
    }

    /**
     * Set checksum of identity (or content)
     */
    function setChecksum(bytes8 id, bytes32[2] memory checksum) public payable _isOwner(id, msg.sender) {
        publishers[id].checksum = checksum;
    }

    /**
     * Set hosts
     */
    function setHosts(bytes8 id, bytes32 host1, bytes32 host2) public payable _isOwner(id, msg.sender) {
        publishers[id].hosts[0] = host1;
        publishers[id].hosts[1] = host2;
    }

    /**
      * Transfer Publisher to another owner
      */
    function transfer(bytes8 id, address newOwner) public payable _isOwner(id, msg.sender)  returns (bool) {
        owners[id] = newOwner;
    	return true;
    }

    // ------------------------------------------------------------------------------------------------
    // ------------------------------------------------------------------------------------------------

    /**
      * Verify the publisher is existing, active and not disabled
      */
    function isAvailable(bytes8 id) public view returns (bool){
        return publishers[id].created != 0 && publishers[id].active == true;
    }

    /**
      * Verify the given account is owning the publisher
      */
    function isOwner(bytes8 id, address ownerAddress) public view returns (bool){
        return owners[id] == ownerAddress;
    }

    /**
     * Return address of Publisher owner
     */
    function getOwner(bytes8 id) public view returns (address) {
        return owners[id];
    }

    /**
     * Get Publisher data
     */
    function get(bytes8 id) public view  returns (Publisher memory){
        return publishers[id];
    }

}
